import React, { Component } from 'react';
import Todos from './components/Todos'

class App extends Component {
  render (){

  state = {
     todos : [
       {
         id: 1,
         title: 'Learn react',
         completed: false
       }, 
       {
        id: 2,
        title: 'Learn spring',
        completed: false
      }, 
      {
        id: 3,
        title: 'Learn docker',
        completed: false
      }, 
     ]
  }

  return (
    <div className="App">
    <Todos/>

    </div>
  );
}
}

export default App;
